import React from 'react';

const Header = ({ }) => {
  return (
    <div className='header'>
      <h1 className='f1 tl title ml3'>HBC Coffee Week</h1>
      <h3 className='f1 tl' id='weekIndicator'>Test</h3>
    </div>
  );
}

export default Header;
